import React, { useState } from "react";
import logo from "./logo.png"; // replace with your logo

const Footer = () => {
  const [email, setEmail] = useState("");

  const handleSubmit = (e) => {
    e.preventDefault();
    if (!email) {
      alert("Please fill out this form");
    } else {
      alert(`Thank you for subscribing with ${email}`);
      setEmail("");
    }
  };

  return (
    <footer style={styles.footer}>
      {/* Center subscription */}
      <div style={styles.centerSection}>
        <h1 style={styles.getInTouch}>Get in touch with us</h1>
        <h2 style={styles.subscribeNow}>
          Subscribe now for exclusive property insights and deals
        </h2>

        {/* Input + Submit button inside */}
        <form style={styles.form} onSubmit={handleSubmit}>
          <div style={styles.inputWrapper}>
            <input
              type="email"
              placeholder="Enter your email"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              style={styles.input}
            />
            <button type="submit" style={styles.button}>Subscribe</button>
          </div>
        </form>
      </div>

      {/* Bottom section */}
      <div style={styles.bottomSection}>
        <div style={styles.bottomLeft}>
          <img src={logo} alt="Logo" style={styles.logo} />
          <span style={styles.brandName}>Prop Boot</span>
        </div>

        <div style={styles.bottomCenter}>
          <a href="#" style={styles.link}>For Sale</a>
          <a href="#" style={styles.link}>Rentals</a>
          <a href="#" style={styles.link}>New Projects</a>
          <a href="#" style={styles.link}>Property News</a>
        </div>

        <div style={styles.bottomRight}>
          Â© 2025 Prop Boot. All rights reserved.
        </div>
      </div>
    </footer>
  );
};

const styles = {
  footer: {
    backgroundColor: "#1c3f6c", // blue-ish
    color: "white",
    padding: "50px 20px 20px 20px",
    fontFamily: "Arial, sans-serif",
  },
  centerSection: {
    textAlign: "center",
    marginBottom: "50px",
  },
  getInTouch: {
    fontSize: "28px",
    marginBottom: "10px",
  },
  subscribeNow: {
    fontSize: "20px",
    marginBottom: "20px",
    fontWeight: "normal",
  },
  form: {
    display: "flex",
    justifyContent: "center",
  },
  inputWrapper: {
    position: "relative",
    width: "300px",
  },
  input: {
    width: "100%",
    padding: "12px 20px",
    paddingRight: "120px", // space for button inside
    borderRadius: "50px",
    border: "none",
    outline: "none",
    fontSize: "16px",
    backgroundColor: "white",
    color: "#000",
  },
  button: {
    position: "absolute",
    right: "0",
    top: "0",
    height: "100%",
    border: "none",
    borderRadius: "50px",
    padding: "0 20px",
    backgroundColor: "#0d6efd",
    color: "white",
    fontSize: "16px",
    cursor: "pointer",
  },
  bottomSection: {
    display: "flex",
    justifyContent: "space-between",
    alignItems: "center",
    flexWrap: "wrap",
    borderTop: "1px solid rgba(255,255,255,0.3)",
    paddingTop: "20px",
  },
  bottomLeft: {
    display: "flex",
    alignItems: "center",
    gap: "10px",
    marginLeft: "20%",
  },
  logo: {
    width: "40px",
    height: "40px",
  },
  brandName: {
    fontSize: "18px",
    fontWeight: "bold",
  },
  bottomCenter: {
    display: "flex",
    gap: "20px",
    justifyContent: "center",
    flexWrap: "nowrap", // links in one line
  },
  link: {
    color: "white",
    textDecoration: "none",
    fontSize: "16px",
  },
  bottomRight: {
    marginRight: "20%",
    fontSize: "14px",
  },
};

export default Footer;
